	add("spiculum", "{\"term\":\"spiculum\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027spīculum\u0027 (a little, sharp point) from \u0027spīcum\u0027 alternative form of \u0027spīca\u0027 (point, spike)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A thrusting javelin used by Romans that replaced the pilum in the late 3rd century\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A sharp, pointed crystal, especially of ice\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A sharp, needle-like structure, especially those making up the skeleton of a sponge\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A small radial emission of gas seen in the chromosphere and corona of the sun\", \"priority\":4}]}, \"synonyms\":{}}");

	add("spider", "{\"term\":\"spider\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"Danish\", \"German\", \"English\", \"middle english (1100-1500)\", \"West Frisian\", \"Dutch\", \"scots\", \"Swedish\"], \"text\":\"From Middle english (1100-1500) {{m|enm|spithre}}, from Old english (ca. 450-1100) {{m|ang|spīder}}, {{m|ang|spīþra||spider}}, from Proto-germanic {{m|gem-pro|*spinþrô||spider\u0026quot;, literally, \u0026quot;spinner}}, from Proto-indo-european {{m|ine-pro|*(s)pend-}}, {{m|ine-pro|*(s)pen-||to pull, stretch, spin}}. Cognate with Scots {{m|sco|spider||spider}}, West frisian {{m|fy|spin||spider}}, Dutch {{m|nl|spin||spider}}, German {{m|de|Spinne||spider}}, Danish {{m|da|spinder||spinner, spider}}, Swedish {{m|sv|spindel||spider}}. More at {{l|en|spin}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of various eight-legged, predatory arthropods, of the order \u0027Araneae\u0027, most of which spin webs to catch prey\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A program which follows links on the World Wide Web in order to gather information\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A float (drink) made by mixing ice-cream and a soda or fizzy drink (such as lemonade\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Katharine Gasparini, \u0027Cranberry and vanilla ice cream \u0027\u0027spider\u0027\u0027\u0027, recipe in \u0027Cool Food\u0027, spiders%22\u0026amp;hl\u003den\u0026amp;ei\u003dfJvPTrKyCMWUiQeFndDCDg\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;redir_esc\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"spiders%22\u0026amp;f\u003dfalse page 339\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A spindly person\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A man who persistently approaches or accosts a woman in a public social setting, particularly in a bar\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A stick with a convex arch-shaped notched head used to support the cue when the cue ball is out of reach at normal extension; a bridge\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A cast-iron frying pan with three legs, once common in open-hearth cookery\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1846\u0027\u0027, Mary Hooker Cornelius, \u0027The Young Housekeeper\u0027s Friend\u0027, [http://catalog.hathitrust.org/Record/008611479 page\u0026amp;nbsp;146], recipe\u0026amp;nbsp;28 “To fry salt pork”\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Cut slices and lay them in cold water in the \u0027\u0027spider\u0027\u0027; boil them up two or three minutes, then pour off the water and set the \u0027\u0027spider\u0027\u0027 again on the coals and brown the slices on each side\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Marty Davidson, \u0027Grandma Grace\u0027s Southern Favorites\u0027, recipe for “strawberry coconuts”, Rutledge Hill Press, ISBN 1-4016-0219-3, page\u0026amp;nbsp;193\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"In \u0027\u0027spider\u0027\u0027 pan or deep skillet set over hot coals, quickly fry a few at a time in deep lard until brown\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Corona Club (San Francisco, California), \u0027Corona Club Cook Book\u0027, spiders%22\u0026amp;hl\u003den\u0026amp;ei\u003dzKLPTqyxMYuImQX7vJihDQ\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;redir_esc\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"spiders%22\u0026amp;f\u003dfalse page 202\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Melt ½ the dry sugar in the \u0027\u0027spider\u0027\u0027, stirring with knife until all is melted\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Implement for moving food in and out of hot oil for deep frying, with a circular metal mesh attached to a long handle\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, City and Guilds of London Institute, \u0027Food preparation and cooking. Cookery units. Student guide.\u0027, Stanley Thornes, ISBN 0-7487-2566-0, unit 2ND5, element\u0026amp;nbsp;2, page\u0026amp;nbsp;157\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"If you are deep-frying your falafel, use a \u0027\u0027spider\u0027\u0027 or basket to place them gently into the hot oil, which should be preheated to a temperature of 175°C (330°F\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Anna Kasabian and David Kasabian, \u0027The Wild Fish Cookbook\u0027, Creative Publishing International, ISBN 1-58923-317-4, page\u0026amp;nbsp;84\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"Consider investing in a frying basket or a \u0027\u0027spider\u0027\u0027 for small amounts of fish. A \u0027\u0027spider\u0027\u0027 looks like a metal web and has a long handle and can lower and raise fish from the hot oil\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"A part of a crank, to which the chainrings are attache\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"Heroin (street drug\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"Part of a resonator instrument that transmits string vibrations from the bridge to a resonator cone at multiple points\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"A skeleton or frame with radiating arms or members, often connected by crosspieces, such as a casting forming the hub and spokes to which the rim of a fly wheel or large gear is bolted; the body of a piston head; or a frame for strengthening a core or mould for a casting\", \"priority\":25}]}, \"synonyms\":{}}");

	add("spiderhunter", "{\"term\":\"spiderhunter\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|spider|hunter|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A large Asian sunbird of the genus \u0027Arachnothera\u0027, feeding on nectar and a range of small arthropods\", \"priority\":1}]}, \"synonyms\":{}}");

	add("spiderwort", "{\"term\":\"spiderwort\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|spider|wort|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A perennial plant of the \u0027Tradescantia\u0027 genus, found in clumps in woodland and meadow\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"One morning she had me traipsing out at the crack of dawn for prickly poppy, toadflax, \u0027\u0027spiderwort\u0027\u0027, and skeleton weed. If that doesn\u0027t sound like the makings of a witch\u0027s brew, then I\u0027m the queen of England\", \"priority\":2}]}, \"synonyms\":{}}");

	add("spidey", "{\"term\":\"spidey\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|spider|y|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1978\u0027\u0027, \u0027Princeton Alumni Weekly\u0027, Volume 79, page 8\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Seven months later he reappeared in his own comic book, The Amazing Spider-Man. In the 16 years since, \u0027\u0027Spidey\u0027\u0027 (as his fans call him) has become the country\u0027s most popular superhero, appearing in 300 daily newspapers\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1981\u0027\u0027, \u0027Ebony Jr.\u0027, Oct. 1981, Vol. 9, No. 4, page 25\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"In the closet Marvin found his sea shell collection, baseball cards, a stack of \u0027\u0027Spidey\u0027\u0027 comic books, a jar of dead flies he had forgotten about, a paper bag filled with pine cones, and five cans of mud from Lake Washington\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1983\u0027\u0027, \u0027Boys\u0027 Life\u0027, Jan 1983, Vol. 73, No. 1, page 21\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Only Spider-Man\u0027s \u0027\u0027spidey\u0027\u0027 powers can get us out of this\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Gerry Conway, ‎Leah Wilson, \u0027Webslinger: Unauthorized Essays On Your Friendly Neighborhood Spider-Man\u0027, page 32\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"H]e\u0027s also written a \u0027\u0027Spidey\u0027\u0027 short story (“Arms and the Man” in 1997\u0027s Untold Tales of Spider-Man) and a \u0027\u0027Spidey\u0027\u0027 novel (\u0027Down These Mean Streets\u0027 in 2005\", \"priority\":8}]}, \"synonyms\":{}}");

	add("spiff", "{\"term\":\"spiff\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Attractiveness or charm in dress, appearance, or manne\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Without a diploma, he relies on \u0027\u0027spiff\u0027\u0027 alone to climb the corporate ladder\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A well-dressed ma\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A bonus or other remuneration, given for reaching a sales goal or promoting the goods of a particular manufacturer. Originally from textile retailing, a percentage given for selling off surplus or out-of-fashion stock, of which the sales person could offer part as a discount to a customer\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"a hand-rolled marijuana cigarette; a join\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Leone Ross, \u0027Tasting Songs\u0027, in \u0027Dark Matter\u0027 (ed. Sheree R. Thomas), [http://books.google.com/books?id\u003dYJzq2aJuJ04C\u0026amp;pg\u003dPA76\u0026amp;dq\u003dspiff\u0026amp;sig\u003dWXqViidaoM32fZMWwtmEwkL9TCA p76\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"She rolled a \u0027\u0027spiff\u0027\u0027 for us as she spoke, sifting the ganja between her fingers\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Sander L. Gilman, Xun Zhou, \u0027Smoke: A Global History of Smoking\u0027, [http://books.google.com/books?id\u003dmM5bYb_uVcwC\u0026amp;pg\u003dPA144\u0026amp;dq\u003dspiff\u0026amp;sig\u003d96IXxEc5XORi92P9yVPKp1jWfKg p144\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"someone else built a \u0027\u0027spiff\u0027\u0027 which he lit and gave to me\", \"priority\":9}]}, \"synonyms\":{}}");

	add("spiflication", "{\"term\":\"spiflication\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"See spiflicate\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the act of spiflicating, or the state of being spiflicated, annihilatio\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1855:\u0027\u0027 Whose blood he vowed to drink \u0026amp;mdash; the Oriental form of threatening \u0027\u0027spiflication\u0027\u0027 - w:Richard Francis Richard Francis Burton, \u0027Pilgrimmage to El-Medinah and Mecca\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1859:\u0027\u0027 ... you had better not mention \u0026amp;mdash; to quote Johnson \u0026amp;mdash; of Benson\u0027s \u0027\u0027spiflication\u0027\u0027 - w:George George Meredith, \u0027The Ordeal of Richard Feverel\u0027, Chapter XXI\", \"priority\":3}]}, \"synonyms\":{}}");

