	add("spikelet", "{\"term\":\"spikelet\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|spike|let|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small, or secondary spike, especially one of many in the inflorescence of a grass or sedge\", \"priority\":1}]}, \"synonyms\":{}}");

	add("spikenard", "{\"term\":\"spikenard\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A perfumed ointment\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"While the king sitteth at his table, my \u0027\u0027spikenard\u0027\u0027 sendeth forth the smell thereof\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The plant, from which the ointment comes\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A garden inclosed is my sister, my spouse; a spring shut up, a fountain sealed. Thy plants are an orchard of pomegranates, with pleasant fruits; camphire, with \u0027\u0027spikenard\u0027\u0027, \u0027\u0027Spikenard\u0027\u0027 and saffron; calamus and cinnamon, with all trees of frankincense; myrrh and aloes, with all the chief spice\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Nard, another species used in antiquity to produce an aromatic oil\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"All plants of \u0027Aralia\u0027, a genus of Araliaceae family\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"or , plant species from the genu\", \"priority\":8}]}, \"synonyms\":{}}");

