	add("spime", "{\"term\":\"spime\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Coined by w:Bruce Sterling|Bruce Sterling in 2004, as a {{blend|space|time|nocap\u003d1|lang\u003den}}.\u0026lt;ref\u0026gt;Bruce Sterling: [http://www.wired.com/wired/archive/12.10/view.html?pg\u003d4 \u0027Dumbing Down Smart Objects\u0027], \u0027Wired\u0027 Issue 12.10, October 2004.\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"an object that could be remotely tracked through space and time\", \"priority\":1}]}, \"synonyms\":{}}");

	add("spine", "{\"term\":\"spine\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027espine\u0027 (modern French \u0027épine\u0027 or its source, Latin \u0027spīna\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The series of bones situated at the back from the head to the pelvis of a person, or from the head to the tail of an animal; backbone, vertebral column\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1851\u0027\u0027, \u0027\u0027, s:Moby-Dick/Chapter chapter 80\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"If you attentively regard almost any quadruped\u0027s \u0027\u0027spine\u0027\u0027, you will be struck with the resemblance of its vertebrae to a strung necklace of dwarfed skulls\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"title\u003dThe Mirror and the url\u003dhttp://openlibrary.org/works/OL1097634W|year\u003d1918|passage\u003dThe preposterous altruism too! Resist not evil. It is an insane immolation of self—as bad intrinsically as fakirs stabbing themselves or anchorites warping their \u0027\u0027spines\u0027\u0027 in caves scarcely large enough for a fair-sized dog\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Something resembling a backbone, such as a ridge, or a long, central structure from which other structures radiate\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"page\u003d75|isbn\u003d978-3-540-45899-9|passage\u003dThe polyhedron \u0027P\u0027∪\u0027D\u0027 is a special \u0027\u0027spine\u0027\u0027 of the twice punctured \u0027M\u0027, that is, of \u0027M\u0027 with two balls \u0027B\u0027\u0026lt;sub\u0026gt;1\u0026lt;/sub\u0026gt;, \u0027B\u0027\u0026lt;sub\u0026gt;2\u0026lt;/sub\u0026gt; cut out of it. To get a \u0027\u0027spine\u0027\u0027 of \u0027M\u0027, we make a hole in \u0027c\u0027′ or \u0027c\u0027″ depending on which of them is a common face of these balls\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The narrow, bound edge of a book\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A rigid, pointed surface protuberance or needle-like structure on an animal, shell, or plant\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1871\u0027\u0027, \u0027\u0027, s:Descent of Man/Chapter chapter XII\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The male, as Dr. Gunther informs me, has a cluster of stiff, straight \u0027\u0027spines\u0027\u0027, like those of a comb, on the sides of the tail\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Courage or assertiveness\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"page\u003d409|isbn\u003d978-0-521-78512-9|passage\u003dTrademark Owners will nevertheless try to dictate how their marks are to be represented, but dictionary publishers with \u0027\u0027spine\u0027\u0027 can resist such pressure\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The stiffness of an arrow\", \"priority\":13}]}, \"synonyms\":{}}");

	add("spinach", "{\"term\":\"spinach\", \"etymology\":{\"influencers\":[], \"languages\":[\"Arabic\", \"English\", \"Persian\", \"old french (842-ca. 1400)\", \"old provençal (to 1500)\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027spinache\u0027 from Old french (842-ca. 1400) \u0027espinoche\u0027 from Old provençal (to 1500) \u0027espinarc\u0027 from Arabic \u0027اِسْفَانَاخ\u0027 from Persian \u0027اسپناخ|tr\u003dispanākh|sc\u003dfa-arab\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A particular edible plant, \u0027Spinacia oleracea\u0027, or its leaves\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any of numerous plants, or their leaves, which are used for greens in the same way \u0027Spinacia oleraceae\u0027 is\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Chinese spinach\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Malabar spinach\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"New Zealand spinach\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"water spinach\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"various nightshade, legume, and Cucurbitaceae species\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Beta vulgaris\u0027: chard\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Lincolnshire spinach (: Good King Henry\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"mountain spinach \u0027Atriplex\u0027 spp\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Rumex acetosa\", \"priority\":11}]}, \"synonyms\":{}}");

	add("spindle", "{\"term\":\"spindle\", \"etymology\":{\"influencers\":[{},{},{}], \"languages\":[\"old english (ca. 450-1100)\", \"Danish\", \"German\", \"English\", \"middle english (1100-1500)\", \"Dutch\", \"Swedish\"], \"text\":\"From Middle english (1100-1500) \u0027spindle\u0027 \u0027spyndel\u0027 \u0027spyndylle\u0027 from Old english (ca. 450-1100) \u0027spindle\u0027 \u0027spindel\u0027 alteration of earlier \u0027spinel\u0027 \u0027spinil\u0027 \u0027spinl\u0027 (spindle) from Proto-germanic {{m|gem-pro|*spinnilō||spindle}}, equivalent to {{suffix|spin|le|lang\u003den}}. Cognate with Scots \u0027spindil\u0027 \u0027spinnell\u0027 (spindle) Dutch \u0027spil\u0027 {{gloss|\u0026quot;spindle\u0026quot;; \u0026lt; Middle Dutch \u0027spille\u0027 \u0027spinle\u0027 }, German \u0027spindel\u0027 (spindle) Danish \u0027spindel\u0027 (spindle) Swedish \u0027spindel\u0027 (spindle)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A rod used for spinning and then winding natural fibres (especially wool), usually consisting of a shaft and a circular whorl positioned at either the upper or lower end of the shaft when suspended vertically from the forming thread\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A rod which turns, or on which something turns\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027spindle\u0027\u0027 of a vane\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"title\u003dOpening issue\u003d2|page\u003d112-3| passage\u003dA doorknob of whatever roundish shape is effectively a continuum of levers, with the axis of the latching mechanism\u0026amp;mdash;known as the \u0027\u0027spindle\u0027\u0027\u0026amp;mdash;being the fulcrum about which the turning takes place\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A rotary axis of a machine tool or power tool\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A worldwide tree of the genus \u0027Euonymus\u0027, originally used for making the spindles used for spinning wool\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An upright spike for holding paper documents by skewering\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The fusee of a watch\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A long and slender stalk resembling a spindle\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A yarn measure containing, in cotton yarn, 15,120 yards; in linen yarn, 14,400 yards\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A solid generated by the revolution of a curved line about its base or double ordinate or chord\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Any marine univalve shell of the genus ; a\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Any marine gastropod of the genus\", \"priority\":13}]}, \"synonyms\":{}}");

