	add("spinmeister", "{\"term\":\"spinmeister\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|spin|meister|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A media liaison or spokesperson, charged with presenting the spin for their political side\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"lt;!-- seems to appear first in 1988 --\u0026gt\", \"priority\":2}]}, \"synonyms\":{}}");

