	add("spinner", "{\"term\":\"spinner\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{-er|spin}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"agent Agent noun of spin; someone or something who spins\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A conical cover at the center of some aircraft propellers\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The coin thrower in a game of two-up\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Used primarily in the adult film industry, an actress or prostitute with a tiny frame, usually very thin and small-breasted\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An input control for entering a number, with accompanying arrowed buttons that increase or decrease the value\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A spin bowler\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A type of lure consisting of wire, a rotating blade, a weighted body, and one or more hooks\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"An ornamental hubcap that spins independently of the whee\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A goatsucker\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A spinneret\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A kind of dumpling, shaped by \u0026quot;spinning\u0026quot; it in the hands\", \"priority\":11}]}, \"synonyms\":{}}");

	add("spinon", "{\"term\":\"spinon\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|spin|on|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One of three kinds of quasiparticle (the others being the holon and orbiton) that electrons in solids are able to split into during the process of spin–charge separation, when extremely tightly confined at temperatures close to absolute zero\", \"priority\":1}]}, \"synonyms\":{}}");

