	add("spinozist", "{\"term\":\"spinozist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Spinoza|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An adherent of or a specialist in the study of the philosophical doctrines of w:Baruch Baruch Spinoza (1632-1677\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, William E. Connolly, \u0026quot;Review: Spinoza and Us,\u0026quot; \u0027Political Theory\u0027, vol. 29, no. 4, p. 589\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The last chapter explores how a contemporary \u0027\u0027Spinozist\u0027\u0027 might respond\", \"priority\":3}]}, \"synonyms\":{}}");

	add("spinster", "{\"term\":\"spinster\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|spin|ster|lang\u003den}}, from a historical notion of unmarried women spinning thread for a living.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A woman who has never been married, especially one past the typical marrying age according to social traditions\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"If a gentlewoman be termed a \u0027\u0027spinster\u0027\u0027, she may abate the writ\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"One who spins (puts a spin on) a political media story so as to give something a favorable or advantageous appearance; a spin doctor, spin merchant or spin master\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Someone whose occupation was spinning thread\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1601\u0027\u0027, William Shakespeare, \u0027Twelfth Night\u0027 , act II, scene IV\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027spinsters\u0027\u0027 and the knitters in the sun\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A woman of evil life and character; so called from being forced to spin in a house of correction\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A spider; an insect (such as a silkworm) which spins thread\", \"priority\":8}]}, \"synonyms\":{}}");

	add("spinup", "{\"term\":\"spinup\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|spin|up|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The process of a disk drive spin spinning up\", \"priority\":1}]}, \"synonyms\":{}}");

	add("spiro", "{\"term\":\"spiro\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"Latin\"], \"text\":\"From Proto-indo-european {{m|ine-pro|*(s)peys-||to blow, breathe}}. Cognate with Old english (ca. 450-1100) {{m|ang|fisting||breaking wind}}, Albanian {{m|sq|fryj||to blow, breath}}. More at {{l|en|fist}}, {{l|en|fise}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Spironolactone\", \"priority\":1}]}, \"synonyms\":{}}");

	add("spiracle", "{\"term\":\"spiracle\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"Latin \u0027spiraculum\u0027 from \u0027spirare|lang\u003dla\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A pore or opening used (especially by spiders and some fish) for breathing\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The blowhole of a whale, dolphin or other similar species\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Any small aperture or vent for air or other fluid\", \"priority\":3}]}, \"synonyms\":{}}");

	add("spiral", "{\"term\":\"spiral\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027spirale\u0027 from \u0027spiralis\u0027 from Latin \u0027spira\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A curve that is the locus of a point that rotates about a fixed point while continuously increasing its distance from that point\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A helix\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A self-sustaining process with a lot of momentum involved, so it is difficult to accelerate or stop it at once\", \"priority\":3}]}, \"synonyms\":{}}");

	add("spirea", "{\"term\":\"spirea\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of many flowering shrubs, of the genus \u0027Spiraea\u0027, that have clusters of white or pink flower\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The \u0027Astilbe\", \"priority\":2}]}, \"synonyms\":{}}");

	add("spirit", "{\"term\":\"spirit\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) {{m|enm|spirit}}, from Old french (842-ca. 1400) \u0027espirit\u0027 (spirit) from Latin {{m|la|spīritus||breath; spirit}}, from Proto-indo-european {{m|ine-pro|*(s)peys-||to blow, breathe}}. Compare \u0027inspire\u0027 \u0027respire\u0027 \u0027transpire\u0027 all ultimately from Latin {{m|la|spīrō||I breathe, blow, respire}}. Cognate with Old english (ca. 450-1100) \u0027fisting\u0027 ((silent) breaking of wind) Displaced native Middle English \u0027gast\u0027 (spirit) (from Old English {{m|ang|gāst||breath, soul, spirit}}). More at {{l|en|fist}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The collective souls of man or another entity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1097634W The Mirror and the passage\u003d[…] St. Bede\u0027s at this period of its history was perhaps the poorest and most miserable parish in the East End of London. Close-packed, crushed by the buttressed height of the railway viaduct, rendered airless by huge walls of factories, it at once banished lively interest from a stranger\u0027s mind and left only a dull oppression of the \u0027\u0027spirit\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1967\u0027\u0027, MacCormack, \u0027Woman Times Seven\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"a triumph of the \u0027\u0027spirit\u0027\u0027 over the flesh\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A supernatural being, often but not exclusively without physical form; ghost, fairy, angel\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A wandering \u0027\u0027spirit\u0027\u0027 haunts the island\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"John Lock\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Whilst young, preserve his tender mind from all impressions of \u0027\u0027spirits\u0027\u0027 and goblins in the dark\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Enthusiasm\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The manner or style of something\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d4|passage\u003dNo matter how early I came down, I would find him on the veranda, smoking cigarettes, or. And at last I began to realize in my harassed soul that all elusion was futile, and to take such holidays as I could get, when he was off with a girl, in a \u0027\u0027spirit\u0027\u0027 of thankfulness\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Alexander Pop\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A perfect judge will read each work of wit / With the same \u0027\u0027spirit\u0027\u0027 that its author writ\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A volatile liquid, such as alcohol. The plural form spirits is a generic term for distilled alcoholic beverages\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Energy; ardour\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Fulle\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"quot;Write it then, quickly,\u0026quot; replied Bede; and summoning all his \u0027\u0027spirits\u0027\u0027 together, like the last blaze of a candle going out, he indited it, and expired\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"One who is vivacious or lively; one who evinces great activity or peculiar characteristics of mind or temper\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"a ruling \u0027\u0027spirit\u0027\u0027; a schismatic \u0027\u0027spirit\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"Dryde\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"Such \u0027\u0027spirits\u0027\u0027 as he desired to please, such would I choose for my judges\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"Temper or disposition of mind; mental condition or disposition; intellectual or moral state; often in the plural\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"to be cheerful, or in good \u0027\u0027spirits\u0027\u0027; to be down-hearted, or in bad \u0027\u0027spirits\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"God has made a \u0027\u0027spirit\u0027\u0027 of building succeed a \u0027\u0027spirit\u0027\u0027 of pulling down\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"Air set in motion by breathing; breath; hence, sometimes, life itself\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"Spense\", \"priority\":26},{\"upperType\":\"NOUN\", \"text\":\"For, else he sure had left not one alive, / But all, in his Revenge, of \u0027\u0027Spirit\u0027\u0027 would deprive\", \"priority\":27},{\"upperType\":\"NOUN\", \"text\":\"Spense\", \"priority\":28},{\"upperType\":\"NOUN\", \"text\":\"The mild air, with season moderate, / Gently attempered, and disposed so well, / That still it breathed forth sweet \u0027\u0027spirit\", \"priority\":29},{\"upperType\":\"NOUN\", \"text\":\"A rough breathing; an aspirate, such as the letter \u0027h\u0027; also, a mark denoting aspiration\", \"priority\":30},{\"upperType\":\"NOUN\", \"text\":\"Ben Jonso\", \"priority\":31},{\"upperType\":\"NOUN\", \"text\":\"Be it a letter or \u0027\u0027spirit\u0027\u0027, we have great use for it\", \"priority\":32},{\"upperType\":\"NOUN\", \"text\":\"Intent; real meaning; opposed to the letter, or formal statement\", \"priority\":33},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027spirit\u0027\u0027 of an enterprise, or of a document\", \"priority\":34},{\"upperType\":\"NOUN\", \"text\":\"Any of the four substances: sulphur, sal ammoniac, quicksilver, and arsenic (or, according to some, orpiment\", \"priority\":35},{\"upperType\":\"NOUN\", \"text\":\"Chauce\", \"priority\":36},{\"upperType\":\"NOUN\", \"text\":\"the four \u0027\u0027spirits\u0027\u0027 and the bodies seve\", \"priority\":37},{\"upperType\":\"NOUN\", \"text\":\"stannic chloride\", \"priority\":38}]}, \"synonyms\":{}}");

	add("spiritism", "{\"term\":\"spiritism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|spirit|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The belief that the dead communicate with the living, especially through a medium having special powers\", \"priority\":1}]}, \"synonyms\":{}}");

	add("spiritism", "{\"term\":\"spiritism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|spirit|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A philosophical doctrine, established in France in the mid nineteenth century, postulating that humans are essentially immortal spirits that temporarily inhabit physical bodies, and may have influence on the physical world\", \"priority\":1}]}, \"synonyms\":{}}");

	add("spiritualism", "{\"term\":\"spiritualism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A belief that spirits of the dead have both the ability and the inclination to communicate with the living, providing useful knowledge about moral and ethical issues, as well as about the nature of God\", \"priority\":1}]}, \"synonyms\":{}}");

	add("spiritualism", "{\"term\":\"spiritualism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|spiritual|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A philosophic doctrine, opposing materialism, that claims transcendency of the divine being, the altogether spiritual character of reality and the value of inwardness of consciousness\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A belief that the dead communicate with the living, especially through a medium having special powers; spiritism\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"R. H. Hutto\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"What is called \u0027\u0027spiritualism\u0027\u0027 should, I think, be called a mental species of materialism\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The quality or state of being spiritual. \u0026lt;!--Webster 1913--\u0026gt\", \"priority\":5}]}, \"synonyms\":{}}");

